def GC_visualize(seqs):
    m1 = TE_predictor.predictor()
    m2 = Deg_predictor.predictor()
    TEs = []
    Degs = []
    GCs = []
    for seq in seqs:
        GC = 0
        for i in range(0, len(seq)):
            if seq[i] == 'G' or seq[i] == 'C':
                GC += 1
        gc_percent = GC / len(seq)

        TEs.append(m1.predict(seq))
        Degs.append(Deg_predictor.score_sum(m2.predict(seq), label='deg_50C'))
        GCs.append(gc_percent)

    import matplotlib.cm as cm
    sc = plt.scatter(TEs, Degs, c=GCs, cmap=cm.coolwarm)
    plt.colorbar(sc).set_label('GC content')
    plt.xlabel('TE')
    plt.ylabel('Deg')
    plt.savefig('../slurm/logs/statics/img/GC_visualize.png')


def vs_target(samples, labels=None, title=None):
    import seaborn as sns
    import matplotlib.pyplot as plt
    import pandas as pd
    import numpy as np

    n = len(samples)
    data = []

    m1 = TE_predictor.predictor()
    m2 = Deg_predictor.predictor()

    if labels is None:
        labels = ['NSGA3+cxUniform', 'NSGA3+cxTwoPoint', 'NSGA2+cxUniform', 'NSGA2+cxTwoPoint']

    for i, (seqs, label) in enumerate(zip(samples, labels)):
        for seq in seqs:
            te = m1.predict(seq)
            deg = Deg_predictor.score_sum(m2.predict(seq), label='deg_50C')
            data.append((te, deg, label))

    # DataFrameに変換
    df = pd.DataFrame(data, columns=['TE', 'Deg', 'Algorithm'])

    # 最も右下の点を特定
    df['diff'] = df['Deg'] - df['TE']
    rightmost_lowest_point = df.loc[df['diff'].idxmin()]

    # Seabornでプロット
    plt.figure(figsize=(8, 6))
    sns.scatterplot(data=df, x='TE', y='Deg', hue='Algorithm', palette='bright', alpha=0.7, s=20)

    # y = x の線を描画
    x = np.linspace(-0.8, 2.8, 100)
    y = np.linspace(3.8, 19.0, 100)
    X, Y = np.meshgrid(x, y)
    Z = X - Y  # 斜線のパターン

    plt.contour(X, Y, Z, levels=np.arange(-10, 10, 2), colors="gray", linestyles="--", alpha=0.5)
    plt.plot(X[0], X[0], color="gray", label="y = x", linestyle="--", alpha=0.5)


    # 最も右下の点を強調
    import matplotlib.patches as patches
    circle = patches.Ellipse((rightmost_lowest_point['TE'], rightmost_lowest_point['Deg']), width=0.08, height=0.3, color='red', fill=False, linewidth=2)
    plt.gca().add_patch(circle)
    
    # 軸設定
    plt.xlabel('TE')
    plt.ylabel('Deg')
    plt.xlim(-0.8, 2.8)
    plt.ylim(3.8, 19.0)
    plt.legend()

    if title is None:
        plt.savefig('../slurm/logs/statics/img/all_visualize.png')
    else:
        plt.savefig('../slurm/logs/statics/img/'+ title + '.png')

